oxy_webhelp_navlinks = {"prereq_immutable_azr_blob_backup-d22872e16324":{"topics":[{"title":"Configuring an Azure private endpoint for Azure Blob Storage","shortdesc":"<p class=\"shortdesc\">To ensure secure access to your Azure Blob Storage account, before assigning an SLA         Domain or initiating on-demand snapshots, configure an Azure private endpoint. This setup         restricts access to your storage account to a specific virtual network, providing enhanced         security and network isolation.<\/p>","href":"azure_blob\/configuring_azr_pe_blob.html","attributes":{"data-id":"configuring_azr_pe_blob"},"menu":{"hasChildren":false},"tocID":"configuring_azr_pe_blob-d22872e16338","topics":[]},{"title":"Configuring an Azure service endpoint for Azure Blob Storage","shortdesc":"<p class=\"shortdesc\">Configure an Azure service endpoint for an Azure Blob Storage account to ensure         secure connectivity through selected VNets and subnets. With this configuration, Exocompute         instances can access the storage account while maintaining network security and         isolation.<\/p>","href":"azure_blob\/configuring_azr_se_blob.html","attributes":{"data-id":"configuring_azr_se_blob"},"menu":{"hasChildren":false},"tocID":"configuring_azr_se_blob-d22872e16349","topics":[]}]}};